import React from "react";
import './nav.css';
import {fetchData} from '../componentes/hoteles/hoteles'

const NavBar = () => {
  return (
    <div className="container  border-bottom border-black">
      <h2 className="navbar-h2">BUSCA HOTELES</h2>
      <input id="search"
        placeholder="Buscar"
        className="form-control-lg search"
        onKeyUp={e => handleFilterChange(e.target.value)}
      />
    </div>
  );
};

export default NavBar;
